import React from "react";

export default class Button extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  isBorderStyleCurrent = this.props.borderStyle;

  render() {
    return (
      <div>
        {isBorderStyleCurrent ? (
          <div className="button" tabIndex="0" style="border:0.5rem solid">
            {this.props.children}
          </div>
        ) : (
          <div className="button" tabIndex="0">
            {this.props.children}
          </div>
        )}
      </div>
    );
  }
}
